import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{ padding: '1rem', background: '#222', color: '#fff' }}>
      <Link to='/' style={{ color: '#fff', marginRight: '1rem' }}>Home</Link>
      <Link to='/about' style={{ color: '#fff', marginRight: '1rem' }}>About</Link>
      <Link to='/plans' style={{ color: '#fff', marginRight: '1rem' }}>Plans</Link>
      <Link to='/services' style={{ color: '#fff', marginRight: '1rem' }}>Services</Link>
      <Link to='/features' style={{ color: '#fff', marginRight: '1rem' }}>Features</Link>
      <Link to='/team' style={{ color: '#fff', marginRight: '1rem' }}>Our Team</Link>
      <Link to='/contact' style={{ color: '#fff' }}>Contact</Link>
    </nav>
  );
}

export default Navbar;
